import React from "react";
import { Box, Typography } from "@mui/material";
import SpellRow from "./SpellRow";
import { Spell, spellKey } from "../../../types/Spell";

interface SpellOrderProps {
  championName: string;
}

const SpellOrder: React.FC<SpellOrderProps> = ({ championName }) => {
  const baseURL =
    "https://raw.communitydragon.org/latest/plugins/rcp-be-lol-game-data/global/default/assets/characters/" +
    championName +
    "/hud/icons2d/" +
    championName;
    let qSpell : Spell = {
      id: 0,
      name: "Command : Attack",
      icon: baseURL + "q.png",
      spellKey: spellKey.Q,
    };
    let wSpell : Spell = {
      id: 0,
      name: "Command : Dissonance",
      icon: baseURL + "w.png",
      spellKey: spellKey.W,
    };
    let eSpell : Spell = {
      id: 0,
      name: "Command : Protect",
      icon: baseURL + "e.png",
      spellKey: spellKey.E,
    };
    let rSpell : Spell = {
      id: 0,
      name: "Command : Shockwave",
      icon: baseURL + "r.png",
      spellKey: spellKey.R,
    };
  return <Box sx={{ display: "flex", gap: 1, flexDirection: "column" }}>
    <Typography variant="body2" sx={{ mb: 2, color: "#F0E6D2" }}>
      {"Spell Order"}
    </Typography>
    <SpellRow spell={ qSpell } championName={championName} />
    <SpellRow spell={ wSpell } championName={championName} />
    <SpellRow spell={ eSpell } championName={championName} />
    <SpellRow spell={ rSpell } championName={championName} />
  </Box>;
};

export default SpellOrder;
